import React, {Component} from "react";
import {Table} from "reactstrap";

const Categories = (props) => {
    const {recipes} = props
    return (
        <div className='categories'>
            {recipes.map(recipe => (
                <div>recipe.category</div>
            ))}
        </div>
    )
}

export default Categories;
